import React from 'react'


function Shop(props) {
    
    return (
        <div className="clothes">
            <a name="shop-btn"></a>
            {props.paltar.map((index,key)=>
            <div className="price "style={{display:"inline-block"}} key={key}>
             <img src={index.url} />
             <p>{index.dressName}</p>
             <h2>{index.price}AZN</h2>
           
            </div>)
            }
        </div>
    )
}

export default Shop
